import { baseURL } from "./OpenAI";
import { useEffect, React } from "react";
import axios from "axios";

class OpenAINLP extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            urlBase: baseURL,
            petNames: [],
            petSpecie: props.specie,
        };
    }

    GetPetNames() {
        console.log(this.urlBase + "nlp-pet-name/specie/" + this.petSpecie);
        useEffect(() => {
            axios
                .post(this.urlBase + "nlp-pet-name/specie/" + this.petSpecie)
                .then((res) => {
                    this.setState({ petNames: res.data });
                })
                .catch((err) => {
                    console.log(err);
                });
        }, []);
        return petNames;
    }
}

